import React from "react";

const Question = (question_data) => {
  return (
    <tr>
      <th>{question_data.id}</th>
      <th>{question_data.title}</th>
      <th>{question_data.description}</th>
      <th>{question_data.category}</th>
      <th>{question_data.complexity}</th>
    </tr>
  );
};

export default Question;
